import{u as t}from"./index.33ec8670.js";import{o,c as n,aw as a}from"./modules-vue.44fa8951.js";import"./modules-element-plus.c099898d.js";const r={class:"markdown-body"},i=a('<h1 id="introduction" tabindex="-1">introduction <a class="header-anchor" href="#introduction" aria-hidden="true">#</a></h1><p>element-pro-components is a component library for Vue 3 base on <a href="https://element-plus.org/">element-plus</a>, <a href="https://v3.vuejs.org/">vue</a>, <a href="https://next.router.vuejs.org/">vue-router</a></p><div class="warning custom-block"><p class="custom-block-title">Warning</p><p>Before v1.0.0, we may make a large change in the components. If you are using it now, you can refer to the <a href="https://github.com/tolking/element-pro-components/blob/master/CHANGELOG.md">CHANGELOG</a> when you upgrade.</p></div><h2 id="cause" tabindex="-1">Cause <a class="header-anchor" href="#cause" aria-hidden="true">#</a></h2><p>For development, most of the forms and table can be reused, and it is more convenient to use by encapsulating the non-business logic parts into components. At the same time, components can be bound with routing, reducing value passing. And to realize some components that are not used in the admin template on element-plus, etc.</p><p>Although the encapsulation of <code>element-plus</code> is already very good, it is essential to use <code>el-table</code> or <code>el-form</code> to write a lot of <code>el-table-column</code> or <code>el-form-item</code> Code. We convert it into <code>column</code> attribute, and dynamically generate these data by passing in an array. If you data with reactive, when you change the <code>column</code>, the table or form will change accordingly. According to this feature, you can implement permissions and other functions in the way you want</p><h2 id="why-not" tabindex="-1">Why not <a class="header-anchor" href="#why-not" aria-hidden="true">#</a></h2><h3 id="template" tabindex="-1">Template <a class="header-anchor" href="#template" aria-hidden="true">#</a></h3><p>For rapid development, the template may be more convenient, but the template may not be very suitable for you. You may not be used to the <code>prettier</code> or <code>eslint</code> of the template; You may not be able to use the partial dependencies of the template; You may care about the build project is 1M+ size before the page is written\u2026</p><p>The advantage of componentization is that you can build your own development environment. If you want to use <code>vite</code> to build, you can use it, if you don\u2019t want to use <code>eslint</code>, you don\u2019t need it\u2026</p><h3 id="base-on-vue2-element-ui" tabindex="-1">Base on vue2 element-ui <a class="header-anchor" href="#base-on-vue2-element-ui" aria-hidden="true">#</a></h3><p>The development concept of the component library is to face the future, if you look at the source code, you will find that it is like <a href="https://github.com/vuejs/rfcs/pull/227.">script setup</a> of vue3 or like <a href="https://developer.mozilla.org/en-US/docs/Web/CSS/--*">CSS Variables</a> of CSSNext. Under the circumstance of ensuring the compatibility of most browsers, more new features and functions will be used for development</p><h2 id="contribute" tabindex="-1">Contribute <a class="header-anchor" href="#contribute" aria-hidden="true">#</a></h2><p>The component library is still in the early development stage, and need to be improved. If you want to contribute, welcome to <a href="https://github.com/tolking/element-pro-components/pulls">Pull Request</a>. If it\u2019s just a simple document error correction, you can directly PR, but if it\u2019s a bug or a new demand or a new component, it is best to create the <a href="https://github.com/tolking/element-pro-components/issues">issues</a> first.</p><p>git contribute information style reference <a href="https://github.com/vuejs/vue-next/blob/master/.github/commit-convention.md">vue commit-convention</a></p><h2 id="browser-support" tabindex="-1">Browser support <a class="header-anchor" href="#browser-support" aria-hidden="true">#</a></h2><p>IE browser is no longer supported, only modern browsers are supported</p>',17),s=[i],f={setup(c,{expose:e}){return e({frontmatter:{title:"introduction",meta:[{name:"description",content:"ntroduction to the basic information of the element-pro-components component library"},{property:"og:title",content:"introduction"}]}}),t({title:"introduction",meta:[{name:"description",content:"ntroduction to the basic information of the element-pro-components component library"},{property:"og:title",content:"introduction"}]}),(l,h)=>(o(),n("div",r,s))}};export{f as default};
